package leetcode;

/**
 * https://leetcode.com/problems/distinct-subsequences/
 */
public class Problem115 {
    public int numDistinct(String s, String t) {
        int[][] memo = new int[s.length() + 1][t.length() + 1];
        for (int i = 0; i < s.length(); i++) {
            for (int j = 0; j < t.length(); j++) {
                memo[i][j] = -1;
            }
        }
        return numDistinct(s, t, 0, 0, memo);
    }

    private static int numDistinct(String s, String t, int i, int j, int[][] memo) {
        if (j >= t.length()) {
            return 1;
        }
        if (i >= s.length()) {
            return 0;
        }
        if (memo[i][j] != -1) {
            System.out.println("memo");
            return memo[i][j];
        }
        int a = numDistinct(s, t, i + 1, j, memo);
        int b = 0;
        if (s.charAt(i) == t.charAt(j)) {
            b = numDistinct(s, t, i + 1, j + 1, memo);
        }
        int result = a + b;
        memo[i][j] = result;
        return result;
    }

    public static void main(String[] args) {
        Problem115 prob = new Problem115();
//        System.out.println(prob.numDistinct("rabbbit", "rabbit")); // 3
//        System.out.println(prob.numDistinct("abc", "def")); // 0
//        System.out.println(prob.numDistinct("defaxc", "abc")); // 0
//        System.out.println(prob.numDistinct("faxbmcd", "abc")); // 1
//        System.out.println(prob.numDistinct("ab", "abc")); // 0
//        System.out.println(prob.numDistinct(
//            "",
//            "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys")); // 0
        System.out.println(prob.numDistinct(
            "",
            "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys")); // 1456742400
    }
}
